create database cineverse;

use cineverse;

create table movie_type
(
    movie_type_id  varchar(20)  not null
        primary key,
    created_at     datetime(6)  null,
    is_delete      bit          not null,
    move_type_name varchar(255) null,
    updated_at     datetime(6)  null
);


create table province
(
    province_id   varchar(20)  not null
        primary key,
    created_at    datetime(6)  null,
    is_delete     bit          not null,
    province_name varchar(255) null,
    updated_at    datetime(6)  null
);


create table seat_type
(
    seat_type_id   varchar(20)  not null
        primary key,
    created_at     datetime(6)  null,
    is_delete      bit          not null,
    seat_type_name varchar(255) null,
    updated_at     datetime(6)  null
);


create table theater
(
    theater_id      varchar(20)  not null
        primary key,
    created_at      datetime(6)  null,
    is_delete       bit          not null,
    theater_address varchar(255) null,
    theater_name    varchar(255) null,
    updated_at      datetime(6)  null,
    province_id     varchar(20)  null,
    constraint FKrcx0lkcjyx3q3duqf4wo6tm8a
        foreign key (province_id) references province (province_id)
);


create table movie
(
    movie_id      varchar(20)  not null
        primary key,
    actor         varchar(255) null,
    created_at    datetime(6)  null,
    description   varchar(255) null,
    director      varchar(255) null,
    duration      float        null,
    end_date      date         null,
    film_studio   varchar(255) null,
    image_url     varchar(255) null,
    is_delete     bit          not null,
    movie_name    varchar(255) null,
    start_date    date         null,
    status        int          not null,
    trailer_url   varchar(255) null,
    updated_at    datetime(6)  null,
    version       varchar(255) null,
    movie_type_id varchar(20)  null,
    constraint FKhmur35n83fxrt4fwl3qw33qy4
        foreign key (movie_type_id) references movie_type (movie_type_id)
);


create table room
(
    room_id            varchar(20)  not null
        primary key,
    created_at         datetime(6)  null,
    is_delete          bit          not null,
    room_name          varchar(255) null,
    seat_column_number int          not null,
    seat_row_number    int          not null,
    seat_total         int          not null,
    updated_at         datetime(6)  null,
    theater_id         varchar(20)  null,
    constraint FKgsjwyr6yogc2ye1oungrndy6x
        foreign key (theater_id) references theater (theater_id)
);


create table user_tbl
(
    username     varchar(255) charset utf8 not null
        primary key,
    created_date datetime                  null,
    is_delete    bit                       null,
    last_login   datetime                  null,
    password     varchar(255)              null,
    update_at    datetime                  null,
    reset_password_token varchar(255)      null
);


create table role_tbl
(
    role_id   int auto_increment
        primary key,
    role_name varchar(255) not null,
    constraint UK_4sja38wh4qqg2tt7gyls500pn
        unique (role_name)
);


create table user_role_tbl
(
    user_role_id int auto_increment
        primary key,
    role_id      int                       null,
    username     varchar(255) charset utf8 null,
    constraint FKo0jo0qtwu8ytx7rc22f86oy94
        foreign key (username) references user_tbl (username),
    constraint FKpfkvhcexxtyx8f6mceq5sjds4
        foreign key (role_id) references role_tbl (role_id)
);


create table seat
(
    seat_room_id varchar(20)  not null
        primary key,
    created_at   datetime(6)  null,
    is_delete    bit          not null,
    seat_name    varchar(255) null,
    updated_at   datetime(6)  null,
    room_id      varchar(20)  null,
    seat_type_id varchar(20)  null,
    constraint FKd4mx49q62bd2apkk2rfkl8l9w
        foreign key (seat_type_id) references seat_type (seat_type_id),
    constraint FKd7f42843rt05tt66t6vcb7s9u
        foreign key (room_id) references room (room_id)
);


create table customer
(
    customer_id  int auto_increment
        primary key,
    address      varchar(255) charset utf8 null,
    birthday     date                      null,
    email        varchar(255)              not null,
    full_name    varchar(255) charset utf8 not null,
    gender       bit                       not null,
    phone_number varchar(12)               not null,
    username     varchar(255) charset utf8 null,
    constraint UK_dwk6cx0afu8bs9o4t536v1j5v
        unique (email),
    constraint FKf9cd47o3u8w1n025391pnflp
        foreign key (username) references user_tbl (username)
);


create table schedule
(
    room_id           varchar(20) not null,
    shedule_date_time datetime(6) not null,
    created_at        datetime(6) null,
    is_delete         bit         not null,
    updated_at        datetime(6) null,
    movie_id          varchar(30) null,
    primary key (room_id, shedule_date_time),
    constraint FKa6hosaihwhtb3scvamdyh9mlv
        foreign key (movie_id) references movie (movie_id),
    constraint FKh2hdhbss2x31ns719hka6enma
        foreign key (room_id) references room (room_id)
);


create table booking
(
    booking_id   varchar(20) not null
        primary key,
    created_at   datetime(6) null,
    is_delete    bit         not null,
    ticket_total int         not null,
    updated_at   datetime(6) null,
    customer_id  int         null,
    payment_status bit       not null,
    constraint FKlnnelfsha11xmo2ndjq66fvro
        foreign key (customer_id) references customer (customer_id)
);


create table ticket
(
    ticket_id          varchar(20) not null
        primary key,
    created_at         datetime(6) null,
    is_delete          bit         not null,
    updated_at         datetime(6) null,
    booking_id         varchar(20) null,
    room_id            varchar(20) null,
    schedule_date_time datetime(6) null,
    seat_id            varchar(20) null,
    booked             bit         not null,
    price              double      null,
    constraint FKg12hnlyyv0gai6afowtn8d65e
        foreign key (room_id, schedule_date_time) references schedule (room_id, shedule_date_time),
    constraint FKqahao9a85drt47ikjp0b8syvh
        foreign key (seat_id) references seat (seat_room_id),
    constraint FKrg7x158t96nucwslhq2bad6qm
        foreign key (booking_id) references booking (booking_id)
);


create table payment
(
    payment_id  varchar(20) not null
        primary key,
    created_at  datetime(6) null,
    is_delete   bit         not null,
    total_money double      null,
    updated_at  datetime(6) null,
    booking_id  varchar(20) null,
    constraint FKqewrl4xrv9eiad6eab3aoja65
        foreign key (booking_id) references booking (booking_id)
);